import { useState, useEffect } from 'react';

import { BrowserRouter as Routers, Route, Routes } from 'react-router-dom';

import HomePage from './pages/home/home-page.component'
import CollectionPage from './pages/home/home-page.component'
import './App.css';

const App = () => {
	const [collections, setCollections] = useState([]);

	useEffect(() => {
		fetch('http://localhost:3002/api/getCollections')
			.then((response) => response.json())
			.then((collection) => setCollections(collection));
	}, []);
	return (
		<div className='App'>
			<h1 className='app-title'>NFT collection</h1>
			<Routers>
				<Routes>
					<Route path="/" element={<HomePage />} />
					<Route path={`/${collections.collection_name}`} element={<CollectionPage collection={collections.collection_name}/>} />
				</Routes>
			</Routers>
		</div>
	);
};

export default App;
